t.name : ''''}}\n        </div>\n         <div class=\"col-md-6\">\n        <b>Priority:</b> {{row.order_priority ? row.order_priority.display : ''''}}\n        </div>\n         <div class=\"col-md-6\">\n        <b>VL Indication:</b> {{ row.viral_load_indication ? row.viral_load_indication.display : '''' }}\n        </div> \n      </div>      \n    \n    <h5>Sample Information</h5><hr>\n     <div class=\"row\">\n        <div class=\"col-md-6\">\n        <b>Date Sample Collected:</b> {{row.date_sample_collected || ''N/A''}}\n        </div>\n        <div class=\"col-md-6\">\n        <b>Sample Collected By:</b> {{row.sample_collected_by || ''N/A''}}\n        </div>\n      <div class=\"col-md-6\">\n        <b>Sample Type:</b> {{row.sample_type ? _.map(row.sample_type, ''display'')  : ''N/A''}}\n        </div>\n         <div class=\"col-md-6\">\n        <b>Sample Mode:</b> {{row.sample_collection_mode ?  _.map(row.sample_collection_mode, ''display'')   : ''N/A''}}\n        </div>\n        \n        <div class=\"col-md-6\">\n        <b>Date Sample Verified:</b> {{row.date_sample_verified ? row.date_sample_verified : ''''}}\n        </div>\n         <div class=\"col-md-6\">\n        <b>Sample Verified By:</b> {{row.sample_verified_by ? row.sample_verified_by : ''''}}\n        </div>\n         <div class=\"col-md-6\">\n        <b>Sample Verification Comment:</b> {{ row.comment_sample_verified || '''' }}\n        </div> \n        <div class=\"col-md-6\">\n        <b>Sample Transfer Date:</b> {{ row.date_sample_transferred || '''' }}\n        </div> \n      </div>      \n      \n    <h5>Result(s)</h5><hr>\n    <div class=\"row\">\n       <div class=\"col-md-12\">\n      {% util.eachComponent(row.reported_result , function(result) { %}\n        <div class=\"row\">\n        <div class=\"col-md-6\">\n          <b>Date Assayed: </b>{{result.date_assayed || ''N/A''}}\n          </div>\n          <div class=\"col-md-6\">\n         <b>Result Date: </b>{{result.date_result_reported |